INSERT INTO `adminnotification_inbox` VALUES (1,4,'2021-02-26 01:43:39','Disable Notice','To improve performance, collecting statistics for the Magento Report module is disabled by default. \nYou can enable it in System Config.','',0,0),(2,3,'2021-02-26 02:24:39','New version 2.9.8 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.9.8\n                                 ','https://magefan.com/magento2-blog-extension?version=2.9.8',0,0),(3,4,'2021-02-26 02:24:39','FAQ: How to configure &quot;read more&quot; in your Magento 2 blog post',' If you still don&#039;t know how to configure read more functionality in your magento 2 blog post, please read this article.\n                    Online documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',0,0),(4,4,'2021-02-26 02:24:39','NEW Magento 2 Zero Downtime Deployment Extension.',' Do you hate to see when your store is broken while running Magento 2 deployment commands? Install New Zero Downtime Deployment extension and forget about it. Deploy new features and bug fixes without interrupting your customers.','https://magefan.com/magento-2-zero-downtime-deployment?from=ntf-new',0,0),(5,4,'2021-03-23 00:33:54','You&#039;re invited to our webinar this week: How digital commerce can scale B2B selling','Digital commerce is fast becoming the default way to buy—even for B2B customers. In just 8 weeks, Byrne Electrical, the leading manufacturer of power and data solutions for numerous industries, launched an eCommerce portal for more than 1,100 of their customers. To learn how they did it, join George Fabis, Director of IT for Byrne, and Slava Kravchuk, CEO &amp; Founder of Atwix, a Magento Commerce solutions partner, for a live discussion on Thursday, March 25. Register Now: https://bit.ly/3r1MCvG','https://bit.ly/3r1MCvG',0,0),(6,3,'2021-05-03 00:33:17','New version 2.10.0 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.10.0\n                                 ','https://magefan.com/magento2-blog-extension?version=2.10.0',0,0),(7,4,'2021-05-11 20:44:41','Magento Open Source 2.4.2-p1 &amp; 2.3.7 deliver important security updates','The latest releases of Magento Open Source – 2.3.7 and 2.4.2-p1 – are now generally available. The latest release of Magento Open Source includes important security updates. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the updates. Learn how this release can help you save time and maximize resources at Magento.com/blog.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html ',0,0),(8,3,'2021-05-12 01:10:02','New version 2.10.1 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.10.1\n                                 ','https://magefan.com/magento2-blog-extension?version=2.10.1',0,0),(9,4,'2021-08-10 17:53:11','Magento Open Source 2.4.3 available today!','Magento Open Source 2.4.3, along with security-only patches 2.4.2-p1 and 2.3.7-p2, is now generally available. Magento Open Source 2.4.3 includes 33 security and 370+ quality improvements, along with performance and scale enhancements.  With these important updates, we strongly recommend that you upgrade to maintain the highest level of security for your sites. Learn how this release can help you save time and maximize resources in our release blog. ','http://magento.com/blog/magento-news/get-ready-your-peak-season-adobe-commerce-243',0,0),(10,4,'2021-10-01 14:44:47','New, Simplified Upgrade Process and Lifecycle Policy Helps Reduce Your TCO ','Adobe Commerce developed a new release strategy and updated its lifecycle policy in effort to help Merchants lower their total cost of ownership and accelerate their time to innovation. Learn more about how upgrades are now more predictable and easier to implement in our blog.','https://magento.com/blog/accelerating-innovation-through-simplified-release-strategy',0,0),(11,3,'2021-10-11 08:23:11','New version 2.10.3 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.10.3\n                                 ','https://magefan.com/magento2-blog-extension?version=2.10.3',0,0),(12,4,'2021-07-20 00:00:00','FLASH SALES - 15% OFF','15% EXTRA discount on ALL extensions. Flash sales 3 days only. Check it out &amp; get the code','https://www.mageplaza.com/deals/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=july21',0,0),(13,4,'2021-07-22 00:00:00','LAST CHANCE - 15% OFF','15% EXTRA discount on ALL extensions. Last day to have it. Ends . Check it out &amp; get the code','https://www.mageplaza.com/deals/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=july21',0,0);
