INSERT INTO `magefan_blog_post` VALUES (2,'Posuerit Litterarum Formas',NULL,NULL,NULL,'posuerit-litterarum-formas',NULL,NULL,NULL,NULL,NULL,'<p>Diga, Koma and Torus are three kitchen utensils designed for Ommo, a new design-oriented brand introduced at the Ambiente show in February 2016. Minimalist approach, bright colors, stainless steel and matte plastic, abstract shapes and curved lines are the defining features of these products designed to be extremely functional, user-friendly and fun.</p>\r\n<p><br>Diga is a two-color melamine salad bowl where vegetables can be washed, drained and served. The disk at the bottom of the bowl can be turned counterclockwise to drain water when washing vegetables and it can be turned clockwise to lock the drain and hold condiments in the bowl when serving.</p>\r\n<blockquote>\r\n<p>Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy.</p>\r\n</blockquote>\r\n<p><img src=\"{{media url=&quot;wysiwyg/image-blog.jpg&quot;}}\" alt=\"\"><br><br><br></p>\r\n<p>Koma and Torus are two tea infusers, each with an original design and a concealed function. Koma has a round base and a long stainless steel-trimmed handle which offers a comfortable grip and allows.<br><br></p>\r\n<p>And the brushed steel cover opens and closes at the touch of a finger to easily fill and empty the infuser. The perfect way to enjoy brewing tea. Torus is donut-shaped and can cling to any cup. It is accompanied by a case that can contain up to three different diffusers and can be used for dry storage of loose tea.</p>','2021-03-22 07:51:32','2021-03-22 10:09:36','2021-03-22 00:00:00',1,1,0,'magefan_blog/blog-detail.jpg','Blog ',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'Diga, Koma and Torus are three kitchen utensils designed for Ommo, a new design-oriented brand introduced at the Ambiente show in February 2016. Minimalist 